import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Headerleft from "./components/Headerleft";
import Home from "./components/Home";
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/up">
            <Headerleft />
            <Home />
          </Route>
          <Route path="/" element={<Home/>} />

        </Routes>
      </Router>
    </div>
  );
}

export default App;
